import React, { useEffect } from "react";

import { Row, Col, Card } from "react-bootstrap";

import AOS from "aos";
import "aos/dist/aos.css";

export const Question = (title, options) => {
  useEffect(() => {
    AOS.init();
  }, []);

  return (
    <section className="questionbanner" id="question">
      <center>
        <Card className="questioncard" id="questioncard">
          <Card.Title
            id="questiontitle"
            data-aos="fade-down"
            data-aos-duration="2000"
          >
            {title}
          </Card.Title>
          {options}.map((choice) => {
              <Row id="optionrow" data-aos="fade-left" data-aos-duration="1000">
                <Col xs={2} md={1} xl={1}>
                  <button>Select</button>
                </Col>
                <Col>
                  <Card.Text id="optioncontent">{choice.value}</Card.Text>
                </Col>
              </Row>
            }
          );
          <Row id="optionrow" data-aos="fade-left" data-aos-duration="1000">
            <Col xs={2} md={1} xl={1}>
              <button>Select</button>
            </Col>
            <Col>
              <Card.Text id="optioncontent">
                This is a wider card with supporting text below as a natural
                lead-in to additional content. This content is a little bit
                longer.
              </Card.Text>
            </Col>
          </Row>
        </Card>
      </center>
    </section>
  );
};
